    // Modified loadTheme function
    loadTheme: function () {
        const savedTheme = localStorage.getItem('selectedTheme') || 'default-dark';
        this.applyTheme(savedTheme);
        return savedTheme;
    },

    // Keep existing resetTheme function but add favicon update
    resetTheme: function () {
        localStorage.removeItem('selectedTheme');
        this.applyTheme('default-dark');
    },

    // Keep existing getCurrentTheme function
    getCurrentTheme: function () {
        return localStorage.getItem('selectedTheme') || 'default-dark';
    }
