// Initialize with favicon support
document.addEventListener('DOMContentLoaded', function () {
    // Load theme (which will also set favicon)
    themeManager.loadTheme();

    // Create initial favicon link if it doesn't exist
    if (!document.querySelector("link[rel='icon']")) {
        const link = document.createElement('link');
        link.rel = 'icon';
        document.head.appendChild(link);
    }
});

// Make sure theme applies immediately for pages that load quickly
themeManager.loadTheme();